import React from 'react';


function Result({ answers }) {
  // 사용자의 답변을 기반으로 결과를 계산하는 로직을 추가
  let totalScore = 0;
  for (const key in answers) {
    totalScore += answers[key];
  }

  return (
    <div>
      <h1>결과</h1>
      <p>총 점수: {Result.totalScore}</p>
    </div>
  );
}

export default Result;
